import React from 'react';
import { Link } from 'react-router-dom';
import '../css/nav.css';

function Nav() {

  const whereAmI = () => {
    const homeLink = document.getElementsByClassName('home')
  }

  return (
    <section className="navigator">
      <h3>
        Desenvolvedor Back-end
      </h3>
      <nav className="homeLink">
        <Link 
          to="/"
          onChange={ () => whereAmI() }  
        >
          Home
        </Link>
      </nav>
      <nav className="aboutLink">
        <Link to="/sobre">
          Sobre
        </Link>
      </nav>
      <nav className="projectsLink">
        <Link to="/projetos">
          Projetos
        </Link>
      </nav>
      <nav className="contactLink">
        <Link to="/contato">
          Contato
        </Link>
      </nav>
    </section>
  );
}

export default Nav;
